def accumulate_totals(n):

    def is_prime(num):
        if num <= 1:
            return False
        if num == 2 or num == 3:
            return True
        if num % 2 == 0 or num % 3 == 0:
            return False
        i = 5
        w = 2
        while i * i <= num:
            if num % i == 0:
                return False
            i += w
            w = 6 - w
        return True
    prime_total = 1
    non_prime_total = 0
    for i in range(n + 1):
        if i % 3 == 0 or i % 5 == 0:
            if is_prime(i):
                prime_total += i
            else:
                non_prime_total += i
    return (non_prime_total, prime_total)

